            {{ form_row(registrationForm.imageFile, {label: 'Photo de profil:'}) }}
            {{ form_row(registrationForm.plainPassword, {label: 'Mot de passe:'}) }}

            <div class=\"flex\">
                <button type=\"submit\" class=\"btn-default\">Créer</button>
            </div>
        {{ form_end(registrationForm) }}
    </div>
    
{% endblock %}
